import React from "react";
import Clock from './components/Clock';

class App extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <>
        <button onClick={this.createClock} >Add Clock</button>
        <Clock />
      </>
    )
  }
}

export default App;
